% Load the data
load('P3_Parameters.mat');
% Start CVX modeling
cvx_begin
variable x(n)
minimize( c' * x )
subject to
A * x == b
x >= 0
cvx_end
% Display results
disp('Optimal x using CVX:');
disp(x);
% Load the data
load('P3_Parameters.mat');
% Initialize variables
x = max(0.1, rand(n,1)); % Ensure x is strictly positive
lambda = zeros(m,1);     % Dual variables for equality constraints
s = max(0.1, c - A' * lambda); % Ensure s is strictly positive, slack variables
mu = 1;                  % Initial barrier parameter
tol = 1e-8;              % Tolerance for stopping criterion
max_iter = 100;          % Maximum number of iterations
for iter = 1:max_iter
% Compute residuals
r_dual = A' * lambda + s - c;
r_pri = A * x - b;
r_gap = diag(x) * diag(s) * ones(n,1) - mu * ones(n,1);
% Form the KKT matrix
KKT = [diag(s) A' eye(n); A zeros(m,m) zeros(m,n); diag(x) zeros(n,m) diag(s)];
rhs = [-r_dual; -r_pri; -r_gap];
% Solve the KKT system for search directions
deltas = KKT \ rhs;
dx = deltas(1:n);
dlambda = deltas(n+1:n+m);
ds = deltas(n+m+1:end);
% Line search for maximum step size that maintains positivity
alpha = 1;
beta = 0.95;
while min(min(x + alpha * dx), min(s + alpha * ds)) <= 0
alpha = alpha * beta;
end
% Update variables
x = x + alpha * dx;
lambda = lambda + alpha * dlambda;
s = s + alpha * ds;
% Update mu and check for convergence
mu = mu * 0.9;  % Decrease mu to reduce the duality gap
if norm(r_dual, Inf) < tol && norm(r_pri, Inf) < tol && (x' * s) < tol
break;
end
end
% Display results
disp('Optimal x using Manual Primal-Dual Interior Point Method:');
disp(x);
